import React, {Component} from "react";
import API from "../../utils/API";
import "./style.css";

class ListItems extends Component {
    state = {
      plants: [],
    //   name: "",
    //   common: "",
      
    };
  
    componentDidMount() {
      this.loadPlants();
    }
  
    loadPlants = () => {
      console.log("Hi");
      API.getGenus("A")
        .then(res => {
          console.log(res);
          this.setState({ plants: res.data});
        }
        )
        .catch(err => console.log(err));
    };
  
    render() {
      return (
        <div id="list-items">

        </div>
      );
    }
  }
  
  export default ListItems;
